import Event from './event';

export const voidevent: Event = {
    "name": "",
    "picture": "",
    "date": "",
    "locality": "",
    "cost" : 0,
    "maxPlace": 0,
    "dispoPlace": 0,
    "usersReserve": [],
    "_id": ""
}

export default voidevent;
